/* -- The root styles must go in the element of the structure with the name "Description". --*/


/* Styles that will make the description distribute into two columns evenly.

- The "column-gap" property is used to provide spacing between the two columns.
*/
.content-7__description{
  column-count:2;
  column-gap: var(--space-m);

  /* Styles for tablet version */
  @media(max-width: 991px){
    column-gap:var(--space-s);
  }

  /* Styles for the mobile version */
  @media(max-width: 767px){
    column-count:1;
  }
}
